import React,{ useState} from 'react';
import { 
    Box
} from '@mui/system';
import { Button, Dialog, DialogTitle, List, ListItem, ListItemText, Stack, Typography } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const Gopay = (props) =>{
    const {image, name} = props;
    return(
    <Box
    sx={{
        display:'flex',
        flexDirection:'row',
        alignItems:'center',
        gap:'16px',
    }}>
        <Box
        component='img'
        src= {image}
        height='35px'
        />
        <Typography fontFamily='Poppins' fontWeight={500} fontSize='18px'>
            {name}
        </Typography>

    </Box>
    );
};

const payment = [<Gopay name="Gopay" image="'./Soup/Gopay.svg'"/>,'OVO','DANA','Mandiri','BCA','BNI'];

const PaymentMethod = (props) => {
    const navigate = useNavigate();
    const {open, setOpen} = props;
    const handleListItemClick = () => {
        setOpen(false);
      };
  return (
    <Dialog open={open} onClose={()=> setOpen(false)}>           
      <DialogTitle fontFamily='Poppins' textAlign="center" >Select Payment Method</DialogTitle>
        <List sx={{ pt: 0 }}>

        {payment.map((payment) => (
        <ListItem button onClick={() => handleListItemClick(payment)} key={payment}>
            <ListItemText primary={payment} />
        </ListItem>
        ))}

        </List>
        <Stack direction="row" justifyContent="center" gap="16px" margin='5px 15px 10px 15px'>
            <Button 
            variant="outlined" 
            color="primary" 
            sx={{
                width:'155px',
                height: '48px',
                padding: '12px 16px',
            }}
            >Cancel
            </Button>

            <Button 
            variant="contained" 
            color="secondary" 
            onClick={() => navigate('/purchasesuccess')}
            sx={{
                width:'155px',
                height: '48px',
                padding: '12px 16px',
            }}
            >Pay</Button>

        </Stack>
    </Dialog>
  )
};

export default PaymentMethod;
